        private void AddCityIfNotExists(string name, short zipCode, int countyId)
        {
            if (_context.Cities.IgnoreQueryFilters().Any(c => c.Name == name && c.ZipCode == zipCode && c.CountyId == countyId))
            {
                return;
            }

            _context.Cities.Add(new City() { Name = name, ZipCode = zipCode, CountyId = countyId });
            _context.SaveChanges();
        }
